import React from 'react'
import './header.css'
import { Transition } from "react-transition-group";

const AComponent = ({ in: inProp }) => (
  <Transition in={inProp} timeout={500}>
    {state => (
      <div>
        I am {state}
      </div>
    )}
  </Transition>
);

const Header = ({ headerToggle, headerButtonToggled }) => {

  return (
    <div>
      <AComponent in={headerToggle} />
      <ul>
        <li><button onClick={() => headerButtonToggled(!headerToggle, "About")}>About</button></li>
        <li><button onClick={() => headerButtonToggled(!headerToggle)}>Projects</button></li>
        <li><button onClick={() => headerButtonToggled(!headerToggle)}>Contact</button></li>
      </ul>
    </div>
  )
}

export default Header
